import React from 'react';

function ToDoLists(props){
return (
    <>
        <div className='todo_style'>
            <i 
                className='fa fa-times' 
                aria-hidden="true" 
                onClick={function (){props.onSelection(props.id)}}>
            </i>
            <li>{props.text}</li>
        </div>
    </>
)
}
// yahan li k ander to mein map function me pass kie gae parameter jis se stateButton ki values fetch ho rhi hein us ka prop istimal ker rha hun

